name \<string> Name of the function on the window object. callback \<Action<BindingSource, T, TResult>> Callback function that will be called in the Playwright's context. options \<BrowserContextExposeBindingOptions?> Handle \<boolean?> Whether to pass the argument as a handle, instead of passing by value. When passing a handle, only one argument is supported. When passing by value, multiple arguments are supported. returns: \<void> The method adds a function called name on the window object of every frame in every page in the context. When called, the function executes callback and returns a Promise which resolves to the return value of callback. If the callback returns a Promise, it will be awaited. The first argument of the callback function contains information about the caller: { browserContext: BrowserContext, page: Page, frame: Frame }. See Page.ExposeBindingAsync(name, callback, options) for page-only version. An example of exposing page URL to all frames in all pages in the context: using Microsoft.Playwright; using System.Threading.Tasks; class Program { public static async Task Main() { using var playwright = await Playwright.CreateAsync(); var browser = await playwright.Webkit.LaunchAsync(new BrowserTypeLaunchOptions { Headless = false }); var context = await browser.NewContextAsync(); await context.ExposeBindingAsync("pageURL", source => source.Page.Url); var page = await context.NewPageAsync(); await page.SetContentAsync("<script>
" + " async function onClick() {
" + " document.querySelector('div').textContent = await window.pageURL();
" + " }
" + "</script>
" + "<button onclick="onClick()">Click me</button>
" + "<div></div>"); await page.ClickAsync("button"); } } Copy An example of passing an element handle: var result = new TaskCompletionSource<string>(); var page = await Context.NewPageAsync(); await Context.ExposeBindingAsync("clicked", async (BindingSource _, IJSHandle t) => { return result.TrySetResult(await t.AsElement().TextContentAsync()); }); await page.SetContentAsync("<script>
" + " document.addEventListener('click', event => window.clicked(event.target));
" + "</script>
" + "<div>Click me</div>
" + "<div>Or click me</div>
"); await page.ClickAsync("div"); // Note: it makes sense to await the result here, because otherwise, the context // gets closed and the binding function will throw an exception. Assert.Equal("Click me", await result.Task); Copy

name \<string> Name of the function on the window object. callback \<Action<T, TResult>> Callback function that will be called in the Playwright's context. returns: \<void> The method adds a function called name on the window object of every frame in every page in the context. When called, the function executes callback and returns a Promise which resolves to the return value of callback. If the callback returns a Promise, it will be awaited. See Page.ExposeFunctionAsync(name, callback) for page-only version. An example of adding a sha256 function to all pages in the context: using Microsoft.Playwright; using System; using System.Security.Cryptography; using System.Threading.Tasks; class BrowserContextExamples { public static async Task Main() { using var playwright = await Playwright.CreateAsync(); var browser = await playwright.Webkit.LaunchAsync(new BrowserTypeLaunchOptions { Headless = false }); var context = await browser.NewContextAsync(); await context.ExposeFunctionAsync("sha256", (string input) => { return Convert.ToBase64String( SHA256.Create().ComputeHash(System.Text.Encoding.UTF8.GetBytes(input))); }); var page = await context.NewPageAsync(); await page.SetContentAsync("<script>
" + " async function onClick() {
" + " document.querySelector('div').textContent = await window.sha256('PLAYWRIGHT');
" + " }
" + "</script>
" + "<button onclick="onClick()">Click me</button>
" + "<div></div>"); await page.ClickAsync("button"); Console.WriteLine(await page.TextContentAsync("div")); } } Copy

