" + " async function onClick() {
" + " document.querySelector('div').textContent = await window.pageURL();
" + " }
" + "</script>
" + "<button onclick="onClick()">Click me</button>
" + "<div></div>"); await page.ClickAsync("button"); } } Copy An example of passing an element handle: var result = new TaskCompletionSource<string>(); await page.ExposeBindingAsync("clicked", async (BindingSource _, IJSHandle t) => { return result.TrySetResult(await t.AsElement().TextContentAsync()); }); await page.SetContentAsync("<script>
